webpackJsonp([0x7d914dcb8c21],{604:function(a,e){a.exports={data:{markdownRemark:{html:'<h3>Edit Vulnerability Type</h3>\n<p>Programs can now edit the vulnerability type of a report after the report has been submitted. This is to correctly associate a report with the right vulnerability type if a hacker selected the wrong one.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/july_2016_edit_vuln_type-e95713fc7af28c11503992242aff36ae-6aaa9.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 69.07801418439716%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="july_2016_edit_vuln_type"\n        title=""\n        src="/static/july_2016_edit_vuln_type-e95713fc7af28c11503992242aff36ae-e7ffa.png"\n        srcset="/static/july_2016_edit_vuln_type-e95713fc7af28c11503992242aff36ae-49813.png 125w,\n/static/july_2016_edit_vuln_type-e95713fc7af28c11503992242aff36ae-dc8a5.png 250w,\n/static/july_2016_edit_vuln_type-e95713fc7af28c11503992242aff36ae-e7ffa.png 500w,\n/static/july_2016_edit_vuln_type-e95713fc7af28c11503992242aff36ae-6aaa9.png 705w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Policy Versioning</h3>\n<p>Hackers can now see when the policy was last changed and view all policy changes on a program’s Security Page.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/july_2016_policy_versioning-a09606b12236246d033609e9d565f16f-4f2fb.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 17.887323943661972%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="july_policy_versioning"\n        title=""\n        src="/static/july_2016_policy_versioning-a09606b12236246d033609e9d565f16f-e7ffa.png"\n        srcset="/static/july_2016_policy_versioning-a09606b12236246d033609e9d565f16f-49813.png 125w,\n/static/july_2016_policy_versioning-a09606b12236246d033609e9d565f16f-dc8a5.png 250w,\n/static/july_2016_policy_versioning-a09606b12236246d033609e9d565f16f-e7ffa.png 500w,\n/static/july_2016_policy_versioning-a09606b12236246d033609e9d565f16f-4f2fb.png 710w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>No More Negative Reputation for “Needs More Info”</h3>\n<p>We’ve adjusted our reputation system so that reports marked as “Needs More Information” doesn’t result in a -1 reputation hit.</p>\n<h3>Hacktivity on Hacker Profiles</h3>\n<p>We now display all reports hackers have on hacktivity onto their profile page.</p>',frontmatter:{path:"/changelog/2016/july",title:"July 2016"}}},pathContext:{}}}});
